import React from 'react';
import photo from '../../../assets/profile/profile-photo.jpg'
function About() {
    return(
        <section>
            <h2 id='about'>A little about myself...</h2>

            <div>
                <img src={photo} className='profile' alt='Me'/>
            </div>
        </section>
    )
}

export default About;
